        <img id='inputImage' alt='' src={imageUrl} width="500px" height="auto" />
        <div className='bounding-box' style={{top: box.leftCol, right: box.topRow, bottom:box.rightCol, left:box.bottomRol}}></div>
      </div>
    </div>
  )
}

export default FaceRecognition;
